import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Form1 from './form'

// function App() {
//   return (
//     <div className="App">
//      <Form1/>
//     </div>
//   );
// }
class App extends Component{
render() {
  const { match } = this.props;
  return (
    <AppLayout>
      <div className="dashboard-wrapper">
        <Suspense fallback={<div className="loading" />}>
          <Switch>
            <Redirect
              exact
              from={`${match.url}/`}
              to={`${match.url}/feed`}
            />
            <Route
              path={`${match.url}/feed`}
              render={props => <FeedsDashboard {...props} />}
            />
            <Route
              path={`${match.url}/lite-bulbs`}
              render={props => <LiteBulbsDashboard {...props} />}
            />
            <Route
              path={`${match.url}/problems`}
              render={props => <ProblemsDashboard {...props} />}
            />
            <Route
              path={`${match.url}/people`}
              render={props => <PeoplesDashboard {...props} />}
            />
            <Route
              path={`${match.url}/settings`}
              render={props => <SettingsDashboard {...props} />}
            />
            <Route
                path={`${match.url}/profile`}
                render={props => <ProfileDashboard {...props} />}
            />
            <Route
                path={`${match.url}/publicprofile`}
                render={props => <PublicProfileDashboard {...props} />}
            />
            <Route
                path={`${match.url}/changepassword`}
                render={props => <ChangePassword {...props} />}
            />
            <Route
                path={`${match.url}/imageCropper`}
                render={props => <ImageCropExample {...props} />}
            />
            <Route
                path={`${match.url}/viewAllComments`}
                render={props => <ViewAllComments {...props} />}
            />
            <Route
                path={`${match.url}/view_Connections`}
                render={props => <ViewAllConnections {...props} />}
            />
            <Route
                path={`${match.url}/viewSinglePost`}
                render={props => <ViewSinglePost {...props} />}
            />
            <Redirect to="/error" />
          </Switch>
        </Suspense>
      </div>
    </AppLayout>

  );
}
}
export default App;
